dades de alimentação e nutrição realizadas em UANs – Unidades de Alimentação e Nutrição.\r\n As UANs têm como objetivo operacionalizar o provimento nutricional de coletividades.\r\n A produção de refeições numa UAN tem como objetivo manter a saúde de seus clientes, por meio de uma alimentação adequada.\r\n A administração da UAN é delegada ao nutricionista que, cabe a ele as funções de planejamento, organização, supervisão, direção e avaliação de acordo com a Lei nº 8.234/91, nos incisos II, VI e VII do artigo 3º; incisos II, IV, IX e X e Parágrafo único do artigo 4º.\r\n Fazem parte de suas atribuições específicas:\r\n - Planejar cardápios de acordo com as necessidades de seus clientes;\r\n - Fazer especificações de alimentos, utensílios e equipamentos;\r\n -Planejar, coordenar e supervisionar as atividades de seleção, compra e armazenamento de alimentos;\r\n  Para o planejamento na elaboração dos cardápios faz-se necessário um levantamento no número de comensais da coletividade enferma (pacientes) e coletividade sadia (acompanhantes e funcionários) que, são multiplicados por um per capta de cada gênero alimentício utilizado nas preparações de todas as refeições, acrescido um percentual como margem de segurança para que se possa chegar ao quantitativo final.    \r\n  Diante disto a previsão de gêneros é realizada de acordo com o número de refeições servidas nas unidades hospitalares que compõe o complexo UNCISAL para paciente, acompanhantes e servidores, e baseada no cardápio pré-estabelecido, com per capitas de cada item (gênero alimentício) necessário para as preparações, onde estão programadas as seguintes refeições: café da manhã, lanche da manhã, almoço, lanche da tarde, jantar e ceia para os pacientes; café da manhã, almoço e jantar para os acompanhantes; almoço e ceia para os servidores das unidades (nos casos previstos).\r\nA previsão para os quantitativos informados nos planos de suprimentos (PLS) está diretamente ligada ao quantitativo de leitos e número de funcionários (nos casos previstos) de cada unidade do complexo. A Maternidade Escola Santa Mônica – MESM tem capacidade de 70 leitos, atendendo na refeição do almoço e ceia uma média de 170 e 120 funcionários, respectivamente. O Hospital Escola Dr. Hélvio Auto – HEHA possui 55 leitos ativos e 07 de UTI, com uma taxa de ocupação de 70%, atendendo em média 113 funcionários no almoço e 68 na ceia. O Hospital Escola Portugal Ramalho – HEPR possui 170 leitos para atender a população enferma, com média de ocupação de 82%, atendendo também aos pacientes do CAPS 25 pacientes por dia e CEAAD média de 30 pacientes dia, além de funcionários (nos casos previstos).\r\nConsiderando que não há um número fixo de comensais, visto a rotatividade de pacientes atendidos, o levantamento é feito através das estatísticas mensais de fornecimento de refeições para pacientes, acompanhantes e funcionários.','1. INFORMAR NOME DO ÓRGÃO, AS DEMANDAS ANUAIS E LOCAIS DE ENTREGA COM OS RESPECTIVOS QUANTITATIVOS.								\r\n2. APÓS A INFORMAÇÃO DA DEMANDA ANUAL, ESTE PLANO DE SUPRIMENTOS DEVERÁ SER IMPRESSO, ASSINADO PELO ORDENADOR DE DESPESAS E ENCAMINHADO PARA A SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP.								\r\n3. O PRAZO DE ENTREGA DESTE PLANO DE SUPRIMENTO É 22/02/2017. O NÃO ENVIO DO PLANO DE SUPRIMENTO, NO PRAZO SOLICITADO, OU DE UM OFÍCIO INFORMANDO DA NÃO UTILIZAÇÃO DOS ITENS QUE SERÃO REGISTRADOS, ACARRETARÁ NA NÃO UTILIZAÇÃO DAS ATAS DE REGISTRO DE PREÇOS DESSE GRUPO DE DESPESA, BEM COMO A POSSIBILIDADE DE SUJEITAR-SE A FUTURAS AUDITORIAS CONJUNTAS DA AMGESP E CGE.								\r\n4. AS DÚVIDAS PODERÃO SER ESCLARECIDAS JUNTO À SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP, ATRAVÉS DO TELEFONE 3315-7240 OU E-MAILS: atendimento.amgesp@gmail.com / demanda.amgesp@gmail.com								\r\n','2017-02-22','',0,NULL,NULL),(24,'2017-07-13 20:07:09','2017-07-13 20:07:09','028/2017',' AQUISIÇÃO DE GÊNEROS ALIMENTÍCIOS (MOLHOS)',14,'A Alimentação