fazem parte da Uncisal as unidades assistenciais, SVO – Serviço de Verificação de Óbito responsável por necropsias de causa mortis não identificada, funcionando todos os dias, de domingo a domingo, 24 horas por dia. Os seus serviços são direcionados aos casos de mortes clínicas; como também o Ambesp (Ambulatório Especializado) que oferece serviços de pediatria, dermatologia, cardiologia, urologia, proctologia, neurologia, ortopedia, reumatologia, psicologia, gastroenterologia, nutrição, geriatria, endocrinologia, pneumologia, clínico geral, genética, nefrologia e cirurgião plástico, além dos exames de eletrocardiograma e ecocardiograma.\r\nA Uncisal tem aproximadamente 1.300 profissionais da área da saúde (entre médicos, enfermeiros, assistentes sociais, psicólogos, fisioterapeutas, terapeutas ocupacionais, farmacêuticos, biomédicos, técnicos de enfermagem) nas suas unidades hospitalares e assistenciais. ','1. INFORMAR NOME DO ÓRGÃO, AS DEMANDAS ANUAIS E LOCAIS DE ENTREGA COM OS RESPECTIVOS QUANTITATIVOS.			\r\n2. APÓS A INFORMAÇÃO DA DEMANDA ANUAL, ESTE PLANO DE SUPRIMENTOS DEVERÁ SER IMPRESSO, ASSINADO PELO ORDENADOR DE DESPESAS E ENCAMINHADO PARA A SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP.			\r\n3. O PRAZO DE ENTREGA DESTE PLANO DE SUPRIMENTO É 09/05/2017. O NÃO ENVIO DO PLANO DE SUPRIMENTO, NO PRAZO SOLICITADO, OU DE UM OFÍCIO INFORMANDO DA NÃO UTILIZAÇÃO DOS ITENS QUE SERÃO REGISTRADOS, ACARRETARÁ NA NÃO UTILIZAÇÃO DAS ATAS DE REGISTRO DE PREÇOS DESSE GRUPO DE DESPESA, BEM COMO A POSSIBILIDADE DE SUJEITAR-SE A FUTURAS AUDITORIAS CONJUNTAS DA AMGESP E CGE.			\r\n4. AS DÚVIDAS PODERÃO SER ESCLARECIDAS JUNTO À SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP, ATRAVÉS DO TELEFONE 3315-7240 OU E-MAILS: atendimento.amgesp@gmail.com / demanda.amgesp@gmail.com			\r\n','2017-05-09','',0,NULL,NULL),(30,'2017-07-13 22:12:17','2017-07-13 22:12:17','078/2017',' AQUISIÇÃO DE MATERIAL DE ENXOVAL (2)',13,'Justificamos ess