 nas suas unidades hospitalares e assistenciais. ','1. INFORMAR NOME DO ÓRGÃO, AS DEMANDAS ANUAIS E LOCAIS DE ENTREGA COM OS RESPECTIVOS QUANTITATIVOS.			\r\n2. APÓS A INFORMAÇÃO DA DEMANDA ANUAL, ESTE PLANO DE SUPRIMENTOS DEVERÁ SER IMPRESSO, ASSINADO PELO ORDENADOR DE DESPESAS E ENCAMINHADO PARA A SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP.			\r\n3. O PRAZO DE ENTREGA DESTE PLANO DE SUPRIMENTO É 09/05/2017. O NÃO ENVIO DO PLANO DE SUPRIMENTO, NO PRAZO SOLICITADO, OU DE UM OFÍCIO INFORMANDO DA NÃO UTILIZAÇÃO DOS ITENS QUE SERÃO REGISTRADOS, ACARRETARÁ NA NÃO UTILIZAÇÃO DAS ATAS DE REGISTRO DE PREÇOS DESSE GRUPO DE DESPESA, BEM COMO A POSSIBILIDADE DE SUJEITAR-SE A FUTURAS AUDITORIAS CONJUNTAS DA AMGESP E CGE.			\r\n4. AS DÚVIDAS PODERÃO SER ESCLARECIDAS JUNTO À SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP, ATRAVÉS DO TELEFONE 3315-7240 OU E-MAILS: atendimento.amgesp@gmail.com / demanda.amgesp@gmail.com			\r\n','2017-05-09','',0,NULL,NULL),(31,'2017-07-14 19:08:50','2017-07-14 19:08:50','079/2017',' AQUISIÇÃO DE MATERIAL DE ENXOVAL (3)',13,'Justificamos essa aquisição em virtude de: diariamente são manipuladas grandes quantidades de roupas sujas, impregnadas dos mais diversos tipos de sujidade, tais como: sangue, fezes, urina, secreções, vômito, etc. E que os produtos químicos utilizados no tratamento e lavagem do vestuário provocam um desgaste excessivo no tecido, acarretando a diminuição da vida útil.\r\nAlém disso, as unidades hospitalares da Uncisal possuem 448 leitos, sendo 160 no Hospital Escola Portugal Ramalho, único hospital psiquiátrico público de Alagoas, sendo por isto, referência para o atendimento da população de todo o Estado e alguns municípios de Estados circunvizinhos, onde os pacientes devido ao próprio quadro psiquiátrico podem destruir (rasgarem) o enxoval e, que também sofrem desgastes materiais por seu uso contínuo; já o Hospital Escola Dr. Hélvio Auto possui 100 leitos e é especializad