iscrição de uso em locais públicos.','1. INFORMAR NOME DO ÓRGÃO, AS DEMANDAS ANUAIS E LOCAIS DE ENTREGA COM OS RESPECTIVOS QUANTITATIVOS.			\r\n2. APÓS A INFORMAÇÃO DA DEMANDA ANUAL, ESTE PLANO DE SUPRIMENTOS DEVERÁ SER IMPRESSO, ASSINADO PELO ORDENADOR DE DESPESAS E ENCAMINHADO PARA A SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP.			\r\n3. O PRAZO DE ENTREGA DESTE PLANO DE SUPRIMENTO É 09/05/2017. O NÃO ENVIO DO PLANO DE SUPRIMENTO, NO PRAZO SOLICITADO, OU DE UM OFÍCIO INFORMANDO DA NÃO UTILIZAÇÃO DOS ITENS QUE SERÃO REGISTRADOS, ACARRETARÁ NA NÃO UTILIZAÇÃO DAS ATAS DE REGISTRO DE PREÇOS DESSE GRUPO DE DESPESA, BEM COMO A POSSIBILIDADE DE SUJEITAR-SE A FUTURAS AUDITORIAS CONJUNTAS DA AMGESP E CGE.			\r\n4. AS DÚVIDAS PODERÃO SER ESCLARECIDAS JUNTO À SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP, ATRAVÉS DO TELEFONE 3315-7240 OU E-MAILS: atendimento.amgesp@gmail.com / demanda.amgesp@gmail.com			\r\n','2017-05-09','',0,'Priscilla das Graças de Queiroz Silva',NULL),(54,'2017-07-20 21:31:08','2017-07-20 21:31:08','118/2017',' SERVIÇO DE LOCAÇÃO DE APARELHO DE AR CONDICIONADO',18,'A aquisição dos condicionadores de Ar Condicionados/Serviços de locação  de tais equipamentos é de  fundamental importância como forma de  viabilizar a continuidade da prestação de serviços público ofertados por esta universidade (UNCISAL) levando-se em conta uma boa qualidade do ambiente institucional para os funcionários que compõe o complexo com também para os pacientes e alunos de uma forma geral. \r\nA Uncisal tem aproximadamente 1.300 profissionais somente na área da saúde (entre médicos, enfermeiros, assistentes sociais, psicólogos, fisioterapeutas, terapeutas ocupacionais, farmacêuticos, biomédicos, técnicos de enfermagem) nas suas unidades hospitalares e assistenciais, com base nesse quantitativo de servidores, levando em consideração as especificidades de cada área, bem como a demanda informada pelas mesmas é que chegamos aos quantitativos aqui informados.\r\nCabe ressaltar que, as unidades hospitalares da Uncisal possuem 448 leitos, sendo 160 no Hospital Escola Portugal Ramalho, único hospital psiquiátrico público de Alagoas, sendo por isto, referência para o atendimento da população de todo o Estado e alguns municípios de Estados circunvizinhos, já o Hospital Escola Dr. Hélvio Auto possui 100 leitos e é especializado na investigação e tratamento de patologias infectocontagiosas em geral; e a Maternidade Escola Santa Mônica possui 188 leitos, especializada em Assistência de Média e Alta Complexidade, sendo Referência Estadual no Atendimento à Gestante de Alto Risco. Também fazem parte da Uncisal as unidades assistenciais, SVO – Serviço de Verificação de Óbito responsável por necropsias de causa mortis não identificada, funcionando todos os dias, de domingo a domingo, 24 horas por dia. Os seus serviços são direcionados aos casos de mortes clínicas; como também o Ambesp (Ambulatório Especializado) que oferece serviços de pediatria, dermatologia, cardiologia, urologia, proctologia, neurologia, ortopedia, reumatologia, psicologia, gastroenterologia, nutrição, geriatria, endocrinologia, pneumologia, clínico geral, genética, nefrologia e cirurgião plástico, além dos exames de eletrocardiograma e ecocardiograma, além do prédio SEDE, Almoxarifado Central, a Etsal, Ambulatório de Especialidades entre outros que complementam a necessidade pela demanda informada.','1. INFORMAR NOME DO ÓRGÃO, AS DEMANDAS ANUAIS E LOCAIS DE ENTREGA COM OS RESPECTIVOS QUANTITATIVOS.			\r\n2. APÓS A INFORMAÇÃO DA DEMANDA ANUAL, ESTE PLANO DE SUPRIMENTOS DEVERÁ SER IMPRESSO, ASSINADO PELO ORDENADOR DE DESPESAS E ENCAMINHADO PARA A SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP.			\r\n3. O PRAZO DE ENTREGA DESTE PLANO DE SUPRIMENTO É 30/06/2017. O NÃO ENVIO DO PLANO DE SUPRIMENTO, NO PRAZO SOLICITADO, OU DE UM OFÍCIO INFORMANDO DA NÃO UTILIZAÇÃO DOS ITENS QUE SERÃO REGISTRADOS, ACARRETARÁ NA NÃO UTILIZAÇÃO DAS ATAS DE REGISTRO DE PREÇOS DESSE GRUPO DE DESPESA, BEM COMO A POSSIBILIDADE DE SUJEITAR-SE A FUTURAS AUDITORIAS CONJUNTAS DA AMGESP E CGE.			\r\n4. AS DÚVIDAS PODERÃO SER ESCLARECIDAS JUNTO À SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP, ATRAVÉS DO TELEFONE 3315-7240 OU E-MAILS: atendimento.amgesp@gmail.com / demanda.amgesp@gmail.com			\r\n','2017-06-30','',0,'Priscilla das Graças de Queiroz Silva',NULL),(55,'2017-08-08 20:56:37','2017-08-08 20:56:37','144/2017',' AQUISIÇÃO DE DESCARTÁVEIS (01)',12,'A Alimentação Coletiva é representada pelas atividades de alimentação e nutrição realizadas em UANs – Unidades de Alimentação e Nutrição.\r\n As UANs têm como objetivo operacionalizar o provimento nutricional de coletividades.\r\n A produção de refeições numa UAN tem como objetivo manter a saúde de seus clientes, por meio de uma alimentação adequada.\r\n A administração da UAN é delegada ao nutricionista que, cabe a ele as funções de planejamento, organização, supervisão, direção e avaliação de acordo com a Lei nº 8.234/91, nos incisos II, VI e VII do artigo 3º; incisos II, IV, IX e X e Parágrafo único do artigo 4º.\r\n Fazem parte de suas atribuições específicas:\r\n - Planejar cardápios de acordo com as necessidades de seus clientes;\r\n - Fazer especificações de alimentos, utensílios e equipamentos;\r\n -Planejar, coordenar e supervisionar as atividades de seleção, compra e armazenamento de alimentos;\r\n  Para o planejamento na elaboração dos cardápios faz-se necessário um levantamento no número de comensais da coletividade enferma (pacientes) e coletividade sadia (acompanhantes e funcionários) que, são multiplicados por um per capta de cada gênero alimentício utilizado nas preparações de todas as refeições, acrescido um percentual como margem de segurança para que se possa chegar ao quantitativo final.    \r\n  Diante disto a previsão de gêneros é realizada de acordo com o número de refeições servidas nas unidades hospitalares que compõe o complexo UNCISAL para paciente, acompanhantes e servidores, e baseada no cardápio pré-estabelecido, com per capitas de cada item (gênero alimentício) necessário para as preparações, onde estão programadas as seguintes refeições: café da manhã, lanche da manhã, almoço, lanche da tarde, jantar e ceia para os pacientes; café da manhã, almoço e jantar para os acompanhantes; almoço e ceia para os servidores das unidades (nos casos previstos).\r\nA previsão para os quantitativos informados para aquisição de copos descartáveis está diretamente ligada aos quantitativos de refeições ofertadas/realizadas no qual são preparadas diariamente em turnos diferenciados utilizando-se assim os copos, além disso, visa atender toda a demanda das demais unidades visando atender a toda a comunidade de servidores que totalizam mais de 3.000 desenpenhando suas atividades nesta Universidade.','OBSERVAÇÕES:			\r\n1. INFORMAR NOME DO ÓRGÃO, AS DEMANDAS ANUAIS E LOCAIS DE ENTREGA COM OS RESPECTIVOS QUANTITATIVOS.			\r\n2. APÓS A INFORMAÇÃO DA DEMANDA ANUAL, ESTE PLANO DE SUPRIMENTOS DEVERÁ SER IMPRESSO, ASSINADO PELO ORDENADOR DE DESPESAS E ENCAMINHADO PARA A SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP.			\r\n3. O PRAZO DE ENTREGA DESTE PLANO DE SUPRIMENTO É 17/08/2017. O NÃO ENVIO DO PLANO DE SUPRIMENTO, NO PRAZO SOLICITADO, OU DE UM OFÍCIO INFORMANDO DA NÃO UTILIZAÇÃO DOS ITENS QUE SERÃO REGISTRADOS, ACARRETARÁ NA NÃO UTILIZAÇÃO DAS ATAS DE REGISTRO DE PREÇOS DESSE GRUPO DE DESPESA, BEM COMO A POSSIBILIDADE DE SUJEITAR-SE A FUTURAS AUDITORIAS CONJUNTAS DA AMGESP E CGE.			\r\n4. AS DÚVIDAS PODERÃO SER ESCLARECIDAS JUNTO À SUPERINTENDÊNCIA DE LICITAÇÕES E CONTROLE DE REGISTRO DE PREÇO DA AMGESP, ATRAVÉS DO TELEFONE 3315-7240 OU E-MAILS: atendimento.amgesp@gmail.com / demanda.amgesp@gmail.com			\r\n','2017-08-17','',0,'José Cicero Rocha Cavalcante',NULL);
